"use strict";let table=$("#table");document.getElementById("filtrare-tipo").addEventListener("click",(function(){const e=document.getElementById("selezione-tipo").value;switch($('[name="selezione-tipo"]').val(),e){case"site":table.bootstrapTable("filterBy",{type:"site"});break;case"url":table.bootstrapTable("filterBy",{type:"url"});break;case"tinyurl":table.bootstrapTable("filterBy",{type:"tinyurl"});break;default:table.bootstrapTable("filterBy",{});break}}));